import { View, Text,StyleSheet,FlatList } from 'react-native'
import React from 'react'

export default function Example() {
    const futsalData=[
        {id:1,name:"Ankit Dhakal" ,position:"FIXO"},
        {id:2,name:"Nikhil Thapa" ,position:"FIXO"},
        {id:3,name:"Rabin Thapa" ,position:"ALA"},
        {id:4,name:"Seth Pariyar" ,position:"PIVOT"},
        {id:5,name:"Alexis Subedi" ,position:"GK"},
        {id:6,name:"Dabeeg Rana" ,position:"ALA"},
        {id:4,name:"Bishal Budhathoki" ,position:"ALA"},
        {id:4,name:"Sushant Thapa" ,position:"FIXO"},


    ]
  return (
    <View>
    <FlatList
    data={futsalData}
    renderItem={({item})=>{
        return <Text>{item.name}</Text>
    }}
    >

    </FlatList>

    </View>
  )
}

const styles = StyleSheet.create({
    listStyle:{
        textAlign:"center",
        margin:20,
        backgroundColor:"voilet",
        color:"white",
        fontSize:30

    },

    textStyle:{
        color:"white",
        padding:5
    }
})
